    public static void DecryptFrontCode(byte pSrc[], byte pDst[])
    {
        byte Work[] = new byte[12];
        byte Crypt[] = new byte[12];
        Utils.memcpy(Crypt, pSrc, 12);
        Utils.memcpy(pDst, pSrc, 120, 0, 12);

        for(int i = 0; i < 10; i++)
        {
            Utils.memcpy(Work, pSrc, 12, 0, 12 + i * 12);
            pDst[i * 12 + 0] -= Crypt[0];
            pDst[i * 12 + 1] -= Crypt[1];
            pDst[i * 12 + 2] ^= Crypt[2];
            pDst[i * 12 + 3] -= Crypt[3];
            pDst[i * 12 + 4] ^= Crypt[4];
            pDst[i * 12 + 5] ^= Crypt[5];
            pDst[i * 12 + 6] ^= Crypt[6];
            pDst[i * 12 + 7] -= Crypt[7];
            pDst[i * 12 + 8] ^= Crypt[8];
            pDst[i * 12 + 9] -= Crypt[9];
            pDst[i * 12 + 10] -= Crypt[10];
            pDst[i * 12 + 11] ^= Crypt[11];

            for(int j = 0; j < 12; j++)
                Crypt[j] = (byte)FCTable[Utils.pos(Work[j]) * 12 + j];

        }
    }

    public static void mangle(byte[] b)
    {
        b[0] = (byte) ~b[0];
        b[1] ^= 0xf0;
        b[2] ^= 0x0f;
        b[3] ^= 0x77;
        b[4] ^= 0x77;
        b[5] = (byte)~b[5];
        b[6] ^= 0xf0;
        b[7] ^= 0x0f;
        b[8] ^= 0x77;
        b[9] ^= 0x77;
        b[10] = (byte)~b[10];
        b[11] ^= 0xf0;
        b[12] ^= 0x0f;
        b[13] ^= 0x77;
        b[14] ^= 0x77;
    }

    public static String IntToIP(long IP)
    {
        if (IP == 0)
                return "";

        long a = ((IP >> 24) & 0xff);
        long b = ((IP >> 16) & 0xff);
        long c = ((IP >> 8) & 0xff);
        long d = (IP & 0xff);

        return d + "." + c + "." + b + "." + a;
    }

    public static int HexToInt(String strHex)
    {
        int iReturn = 0;

        for (int iPos = 0 ; iPos < strHex.length() ; iPos++)
        {
            iReturn = iReturn * 16 + Character.digit(strHex.charAt(iPos), 16);
        }

        return iReturn;
    }

    public static String IntToHex(int Int)
    {
        return Integer.toHexString(Int);
    }

    public static ParentNodeInfo[] GetParentNode(String PeerCache)
    {
        try
        {
            byte buf[] = new byte[512];
            byte nodebuf[] = new byte[512];

            try
            {
                StreamConnection s = (StreamConnection)Connector.open("socket://" + PeerCache + ":7950", Connector.READ);
                DataInputStream is = s.openDataInputStream();

                if ((readit(is, buf, 0, 1) != 1) || (buf[0] != 0x38))
                {
                    s.close();

                    return null;
                }

                if ((readit(is, buf, 0, 16) != 16) || (WpnEnc.GetCryptKeyID(buf) != 0x54))
                {
                    s.close();

                    return null;
                }

                readit(is, buf, 0, 132);

                s.close();

                ParentNodeInfo nodes[] = new ParentNodeInfo[10];
                DecryptFrontCode(buf, nodebuf);

                for(int i = 0; i < 10; i++)
                {
                    nodes[i] = new ParentNodeInfo(getIntFromArray(nodebuf, 12 * i), getShortFromArray(nodebuf, 12 * i + 4), getShortFromArray(nodebuf, 12 * i + 6), nodebuf[12 * i + 8], nodebuf[12 * i + 9]);
                }

                return nodes;
            }

            catch (IOException e)
            {
                System.err.println("GetParentNode error: " + e.toString());

                return null;
            }
        }

        catch (OutOfMemoryError e)
        {
            e.printStackTrace();

            System.gc();

            return null;
        }
    }

    public static int pos(int b)
    {
        return b >= 0 ? b % 256 : 256 + b % 256;
    }

    public static int memcpy(byte src[], byte dest[], int n)
    {
        for (int i = 0; i < n; i++)
            src[i] = dest[i];

        return n;
    }

    public static int memcpy(byte src[], byte dest[], int n, int start1, int start2)
    {
        for (int i = 0; i < n; i++)
            src[i + start1] = dest[i + start2];

        return n;
    }

    public static int getIntFromArray(byte buf[], int i)
    {
        return pos(buf[i]) | pos(buf[i + 1]) << 8 | pos(buf[i + 2]) << 16 | pos(buf[i + 3]) << 24;
    }

    public static int getShortFromArray(byte buf[], int i)
    {
        return (short)(pos(buf[i]) | pos(buf[i + 1]) << 8) & 0xffff;
    }

    public static int readit(DataInputStream is, byte buff[], int offset, int len)
    {
        if (is == null)
        {
            return -1;
        }

        int ret = 1;
        int done = 0;

        try
        {
            do
            {
                if (ret <= 0 || done >= len)
                {
                    break;
                }

                ret = is.read(buff, done + offset, len - done);

                if (ret > 0)
                {
                    done += ret;
                }
            }
            while (true);

            return done;
        }

        catch (IOException e)
        {
            System.err.println("readit " + is.toString() + " error: " + e.toString());

            return 0;
        }
    }

    public static boolean IsNumeric(String Str)
    {
        for (int i = 0; i < Str.length(); i++)
        {
            if ((Str.charAt(i) < '0') || (Str.charAt(i) > '9'))
            {
                return false;
            }
        }

        return true;
    }

    public static int GetInt(String Str)
    {
        if (IsNumeric(Str))
        {
            return Integer.parseInt(Str);
        }

        return 0;
    }

    public static void MessageBox(Display display, String Caption, String Text, int Timeout, AlertType Type)
    {
        Text = replaceAll(Text, "\n", " - \n");

        if (alert == null)
        {
            alert = new Alert(Caption, Text, null, Type);
            alert.setTimeout(Timeout);

            display.setCurrent(alert);
        }

        else
        {
            alert.setTitle(Caption);
            alert.setString(Text);
            alert.setType(Type);

            if (!alert.isShown())
            {
                alert.setTimeout(Timeout);
                display.setCurrent(alert);
            }
        }
    }

    public static String replaceAll(String text, String searchString, String replacementString)
    {
        StringBuffer sBuffer = new StringBuffer();

        int pos = 0;

        while ((pos = text.indexOf(searchString)) != -1)
        {
            sBuffer.append(text.substring(0, pos) + replacementString);
            text = text.substring(pos + searchString.length());
        }

        sBuffer.append(text);

        return sBuffer.toString();
    }

    public static String GetStandardTime()
    {
        return new Date().toString();
    }

    public static String GetTime(long Time)
    {
        if (Time > 3599)
        {
            return String.valueOf((Time/60)/60) + ":" + String.valueOf((Time/60)-(60*((Time/60)/60))) + ":" + String.valueOf(Time%60);
        }

        else if (Time > 59)
        {
            return String.valueOf(Time/60) + ":" + String.valueOf(Time%60);
        }

        else
        {
            return "00:" + String.valueOf(Time);
        }
    }

    public static Image loadImage(String location)
    {
        Image tmp = null;

        try
        {
            tmp = Image.createImage(location);
        }

        catch (java.io.IOException e)
        {
            System.err.println("Unable to load Image: " + e);
        }

        return tmp;
    }
